import{_ as e}from"./chunks/macerror.m2pj-tUE.js";import{_ as i,c as t,o as s,ag as r}from"./chunks/framework.Bw-5EFTY.js";const l="/assets/macallow.BJm17TE9.jpg",n="/assets/windowsError.DWd65jWK.jpg",m=JSON.parse('{"title":"问题自查","description":"","frontmatter":{},"headers":[],"relativePath":"zh/question/index.md","filePath":"zh/question/index.md"}'),o={name:"zh/question/index.md"};function h(p,a,d,c,u,k){return s(),t("div",null,a[0]||(a[0]=[r('<h1 id="问题自查" tabindex="-1">问题自查 <a class="header-anchor" href="#问题自查" aria-label="Permalink to &quot;问题自查&quot;">​</a></h1><p>如果有遇到问题，自查往往更有效果。</p><ol><li>到 PP issue 中自查，往往有效果：<a href="https://github.com/Sjj1024/PakePlus/issues" target="_blank" rel="noreferrer">https://github.com/Sjj1024/PakePlus/issues</a></li><li>检查自己是否修改过配置或脚本文件，用最原始的配置试试</li><li>检查 token 权限是否给正确了，或者重新填写 token 再试试(不要手动创建 PakePlus/PakePlus-Android/PakePlus-iOS 同名的仓库)</li><li>是否有在群里咨询过，没有的话，先在群里问问试试，<a href="./../exchange/">进群交流</a></li><li>网络问题请检查是否使用了代理或者云电脑等，可以尝试开关代理或切换网络试试。</li><li>如果某些功能没有支持，可以通过赞助 PP 快速优先开发解决。</li><li>windows 用户请卸载掉流氓软件，比如 360 等国产监控软件，否则遇到问题请自己解决</li></ol><h2 id="mac-提示-应用已随坏" tabindex="-1">mac 提示 应用已随坏 <a class="header-anchor" href="#mac-提示-应用已随坏" aria-label="Permalink to &quot;mac 提示 应用已随坏&quot;">​</a></h2><p><img src="'+e+'" alt=""> 这是因为没有给苹果给钱，所以苹果会拒绝你的应用。</p><p>解决办法：</p><ol><li><strong>Mac 用户可能在安装时看到“应用已损坏”的警告。</strong> 请点击“取消”，然后运行以下命令，再重新打开应用：(这是由于应用需要官方签名，才能避免安装后弹出“应用已损坏”的提示，但官方签名的费用每年 99 美元...因此，需要手动绕过签名以正常使用)</li></ol><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">sudo</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> xattr</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -r</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -d</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> com.apple.quarantine</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /Applications/PakePlus.app</span></span></code></pre></div><ol start="2"><li><strong>当你打包应用时，Mac 用户可能在安装时看到“应用已损坏”的警告。</strong> 请点击“取消”，然后运行以下命令，输入电脑密码，再重新打开应用：</li></ol><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">sudo</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> xattr</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -r</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -d</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> com.apple.quarantine</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /Applications/你的软件名称.app</span></span></code></pre></div><ol start="3"><li>或到系统设置 &gt; 隐私与安全 &gt; 安全性 &gt; 仍要打开，就可以了</li></ol><p><img src="'+l+'" alt=""></p><h2 id="windows-提示无法在你电脑上运行" tabindex="-1">windows 提示无法在你电脑上运行 <a class="header-anchor" href="#windows-提示无法在你电脑上运行" aria-label="Permalink to &quot;windows 提示无法在你电脑上运行&quot;">​</a></h2><p><img src="'+n+'" alt=""> 这是因为你下载错版本了，你的电脑是 x64 位的就不要下载 arm 版本的，反之亦然。查看自己电脑是什么版本的可以查看电脑属性，也可以在电脑左下角搜索“系统”，然后点击“关于”，可以看到电脑的系统信息，百度一下就知道了。</p><p>x64 位的下载下面两个结尾的文件：</p><ul><li>x64-setup.exe</li><li>x64-setup.exe.sig</li></ul><p>arm64 位下载下面两个结尾的文件：</p><ul><li>_arm64-setup.exe</li><li>_arm64-setup.exe.sig</li></ul><h2 id="请注意-github-账户免费额度" tabindex="-1">请注意 Github 账户免费额度 <a class="header-anchor" href="#请注意-github-账户免费额度" aria-label="Permalink to &quot;请注意 Github 账户免费额度&quot;">​</a></h2><p>如果打包失败，并提示：</p><blockquote><p>The job was not started because recent account payments have failed or your spending limit needs to be increased. Please check the &#39;Billing &amp; plans&#39; section in your settings</p></blockquote><p>说明你白嫖 Github 过渡，需要支付刀乐才可以使用了。<br> 主意：每个 Github 每月有免费 2,000 分钟 action 使用额度，大约 16 刀，用超了就需要付费了！为了保证账户可用，PakePlus 将会检测到账户使用达到上限之前，禁止使用，直到下个月恢复额度才可以使用。</p><h2 id="无法拖拽文件或元素拖动" tabindex="-1">无法拖拽文件或元素拖动 <a class="header-anchor" href="#无法拖拽文件或元素拖动" aria-label="Permalink to &quot;无法拖拽文件或元素拖动&quot;">​</a></h2><p>原因：<a href="https://v2.tauri.app/reference/config/#dragdropenabled" target="_blank" rel="noreferrer">https://v2.tauri.app/reference/config/#dragdropenabled</a><br> 解决办法：<br> mac 平台: 在更多配置中，关闭 dragDropEnabled 选项，然后重新打包。 windows 平台: 在更多配置中，开启 dragDropEnabled 选项，然后重新打包。</p><h2 id="打包后白屏或报错" tabindex="-1">打包后白屏或报错 <a class="header-anchor" href="#打包后白屏或报错" aria-label="Permalink to &quot;打包后白屏或报错&quot;">​</a></h2><p>打一个测试包，然后右键检查元素看一下是否有报错，有报错根据报错信息解决即可。 如果看不懂报错信息或无法解决，可以进群交流。推荐可以试试 deepseek 是否可以帮你解决问题。</p><h2 id="窗口置顶" tabindex="-1">窗口置顶 <a class="header-anchor" href="#窗口置顶" aria-label="Permalink to &quot;窗口置顶&quot;">​</a></h2><p>在更多配置中，开启 alwaysOnTop 即可</p><h2 id="全屏模式" tabindex="-1">全屏模式 <a class="header-anchor" href="#全屏模式" aria-label="Permalink to &quot;全屏模式&quot;">​</a></h2><p>在更多配置中，开启 fullscreen 即可</p><h2 id="dispatch-错误-404-422-403-等等错误" tabindex="-1">dispatch 错误: 404/422/403 等等错误 <a class="header-anchor" href="#dispatch-错误-404-422-403-等等错误" aria-label="Permalink to &quot;dispatch 错误: 404/422/403 等等错误&quot;">​</a></h2><p>确认 token 权限是否配置正确，然后重新填入 token 试试，往往是 token 权限配置错误导致的。或者点击首页头像然后同步一下试试。</p><h2 id="cannot-read-properties-of-undefined-xxx" tabindex="-1">Cannot read properties of undefined XXX <a class="header-anchor" href="#cannot-read-properties-of-undefined-xxx" aria-label="Permalink to &quot;Cannot read properties of undefined XXX&quot;">​</a></h2><blockquote><p>PakePlus publish action error undefined 等等问题</p></blockquote><p>用最新版本的 PakePlus，然后填入 token 试试，能解决 99%的问题。或者点击首页头像然后同步一下试试。</p><h2 id="网络请求失败-请检查网络再试" tabindex="-1">网络请求失败，请检查网络再试! <a class="header-anchor" href="#网络请求失败-请检查网络再试" aria-label="Permalink to &quot;网络请求失败，请检查网络再试!&quot;">​</a></h2><p>当你遇到这个问题的时候，在浏览器中输入：<a href="https://api.github.com" target="_blank" rel="noreferrer">https://api.github.com</a>，如果有返回一段json说明你的网络是没有问题的。 如果报错 403/443 等或者打不开，那就是你的网络服务商把 github 的接口地址屏蔽了，请科学上网或者换一个网络服务商。 或者关掉所有杀毒软件！群里就有人遇到过这种情况，然后关掉杀毒软件就好了。顺便说一句：360 等流氓软件就不要用了，不但会监控你的电脑，还会上报你的浏览信息，这是非常不道德的行为。</p><h2 id="打包后的软件页面跳转" tabindex="-1">打包后的软件页面跳转 <a class="header-anchor" href="#打包后的软件页面跳转" aria-label="Permalink to &quot;打包后的软件页面跳转&quot;">​</a></h2><p>在打包后的软件中，可以点击页面右键，有 back 按钮，就是返回，有 forword 按钮，就是前进。 就像浏览器中的前进后退按钮一样。也可以通过注入 js 脚本，来实现给页面添加前进后退按钮或快捷键，这类问题直接问 ai 即可。</p><h2 id="打包后页面缩放不正确" tabindex="-1">打包后页面缩放不正确 <a class="header-anchor" href="#打包后页面缩放不正确" aria-label="Permalink to &quot;打包后页面缩放不正确&quot;">​</a></h2><p>默认使用的是标准的电脑显示比例，如何打开之后和你在网页中不一致，请确认你的网页是否进行了缩放，你的电脑屏幕分辨率是否设置正确。</p>',41)]))}const f=i(o,[["render",h]]);export{m as __pageData,f as default};
